import React from 'react';
import { Link } from "react-router-dom"
import "./Card.scss"

function Card({ item }) {
    return (
        <div className="card">
            <Link to={`/product/${item.id}`}>
                <div className="image">
                    <img src={item.img} alt="" />
                </div>
                <h2>{item.title}</h2>
                <h3>{item.price}</h3>
            </Link>
        </div>
    );
}

export default Card;
